import styled from 'styled-components'

export const OuterFooter = styled.div`
  margin: 0;
  padding: 0;
  background: black;
  color: white;
  line-height: 60px;
`

export const FooterContainer = styled.div`
  margin: 0 auto;
  padding: 0 20px;
  max-width: 1100px;
  display: flex;
  justify-content: space-between;
`

export const FooterLeft = styled.div`
  padding: 0 10px;
`

export const FooterRight = styled.ul`
  display: flex;
`

export const FooterLinks = styled.li`
  list-style: none;
  padding: 0 10px;
  padding-bottom: 30px;
`
